INSERT INTO `berita` (`id`, `judul`, `kategori`, `tanggal`, `penulis`, `status`, `content`, `image`, `url`, `created_at`, `updated_at`) VALUES
(2, 'Perkembangan situasi lokasi kejadian gempa bumi Kab. Sigi', 'favorit', '2024-05-02', 'sabda', 'Ya', '<p class=\"ql-align-justify\">Gempa bumi terjadi di Desa Kamarora A dan Kamarora B Kec. Nokilalaki serta Desa Lembantongoa Kec. Palolo Kab. Sigi pada Minggu (06/08/23) berkekuatan 5.3 SR. Berdasarkan data dari BMKG, tercatat hingga Senin (07/08/23) pukul 22.40 WITA terjadi gempa susulan sebanyak 42 kali.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">BPBD Provinsi Sulawesi Tengah menurunkan Tim untuk melakukan kaji cepat dan mengaktifkan pos pendamping bencana. Berdasarkan data yang diperoleh dari tim, Penduduk di Desa Kamarora A sebanyak 1.794 jiwa yang terdiri dari 406 KK, masyarakat di Desa tersebut mendirikan pengungsian mandiri dengan jumlah jiwa yang berada di pengungsian sebanyak 210 jiwa (38 KK) yang terdiri dari 179 jiwa laki-laki, 31 jiwa perempuan, 20 jiwa balita, 13 bayi, 11 orang lansia, serta 2 jiwa penyandang disabilitas. Sedangkan di Desa Kamarora B jumlah penduduk sebanyak 317 jiwa (101 KK) yang terdiri dari 158 laki-laki, 159 perempuan, 16 lansia, 9 bayi, 27 anak anak serta 1 jiwa penyandang disabilitas.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Kebutuhan mendesak di Desa Kamarora A dan Kamarora B yaitu peralatan tidur berupa selimut dan kelambu, makanan siap saji, serta tenda terpal sebagai alas. situasi saat ini, masyarakat dihimbau untuk tetap waspada karena gempa susulan masih terjadi. masyarakat mendirikan tenda masing-masing di luar rumah.</p><p class=\"ql-align-justify\">Hasil pendataan tim di Desa Lembantongoa, Kec. Palolo diperoleh jumlah penduduk sebanyak 792 jiwa yang terdiri dari 375 laki-laki, 417 perempuan, 100 balita, 34 bayi, 69 anak-anak, 11 ibu hamil, 34 ibu menyusui, 52 lansia, 58 orang sakit, dan 12 menyandang disabilitas.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Bangunan terdampak di Dusun I sejumlah 21 unit rumah rusak dan 2 unit rumah ibadah. Dusun II sebanyak 9 unit rumah rusak, Dusun III terdapat 10 unit rumah rusak, Dusun 4 sebanyak 32 unit rumah rusak dan di Dusun 5 sejumlah 7 unit rumah rusak dan 2 fasilitas Pendidikan terdampak yaitu SMP SATAP 26 Sigi dan Sekolah PAUD.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Pengungsian di Desa Lembantongoa terdiri dari pengungsi pos lapangan yang ditempati oleh 216 jiwa pengungsi yang terdiri dari 101 laki-laki, 115 perempuan, 40 anak-anak, 45 balita dan 17 lansia. Selain pengungsi pos lapangan, masyarakat juga membuat pengungsian mandiri di Dusun 5 (lima) sebanyak 576 jiwa yang terdiri dari 274 laki-laki, 302 perempuan, 34 bayi, 55 balita, 69 anak-anak, 11 ibu hamil, 34 ibu menyusui, 58 orang sakit, 34 lansia, serta 12 penyandang disabilitas.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Kebutuhan mendesak di Desa Lembantongoa berupa tenda, logistic PB dan obat-obatan. Kondisi terkini di Desa Lembantongoa, masyarakat tetap dihimbau untuk waspada apabila terjadi gempa susulan dan masyarakat mendirikan tenda masing-masing di luar rumah.</p><p><br></p>', '1716479406612-20230808025521.jpeg', 'http://localhost:5001/public/images/1716479406612-20230808025521.jpeg', '2024-05-23 15:50:06', '2024-05-23 15:50:06'),
(3, 'Kekeringan melanda 3 kecamatan di Kabupaten Banggai Kepulauan', 'rekomendasi', '2024-05-02', 'sabda', 'Ya', '<p class=\"ql-align-justify\">Fenomena el-nino yang masih berlangsung menyebabkan terjadinya kekeringan. Beberapa wilayah di Sulawesi Tengah mengalami dampak tersebut. Kali ini, kekeringan terjadi di 16 Desa yang tersebar di 3 kecamatan yaitu Kec. Bulagi, Kec. Bulagi Selatan dan Kec. Bulagi Utara Kab. Banggai Kepulauan. Berdasarkan data yang diperoleh sebanyak 1.087 KK terdampak di Desa Kec. Bulagi, 304 KK terdampak di Kec. Bulagi Selatan dan 749 KK terdampak di Kec. Bulagi Utara.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Instansi yang terlibat dalam penanganan kekeringan di kab. Banggai Kepulauan diantaranya BPBD Provinsi Sulawesi Tengah, BPBD Kab. Banggai Kepulauan, PMI Kab. Banggai Kepulauan, Damkar Kab. Banggai Kepulauan, PDAM Kab. Banggai Kepulauan, TNI serta Polsek Kec. Bulagi.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Saat ini, masih dilakukan pendistribusian air dengan 3 unit mobil tangki. Air bersih diperoleh dari PDAM Bulagi dan sumber air yang terletak di Desa Bangunemo dengan jarak 23 KM dari Desa Alul. Akses jalan ke Desa Alul yang rusak mengakibatkan proses pengambilan dan pendistribusian air memakan waktu yang lama, serta tedapat kendala pada 2 unit mobil tangki dan tidak dapat melakukan pendistribusian di Desa Alul.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Situasi saat ini, kondisi kekeringan masih berlangsung, masih dibutuhkan air bersih dan mobil tangki air untuk mendukung proses pendistribusian air yang lebih efektif dan merata di seluruh wilayah terdampak.</p><p class=\"ql-align-justify\"><br></p><p><br></p>', '1716479479117-20230611095410.jpeg', 'http://localhost:5001/public/images/1716479479117-20230611095410.jpeg', '2024-05-23 15:51:19', '2024-05-23 15:51:19'),
(4, 'Abrasi pantai menyebabkan rusaknya tanggul laut', 'terbaru', '2024-05-24', 'sabda', 'Ya', '<p class=\"ql-align-justify\">Sulteng - Kejadian Abrasi Pantai yang terjadi di Desa&nbsp;Matanga , Kecamatan&nbsp;Banggai Selatan , Kabupaten Banggai Laut, Sulawesi Tengah, Rabu(26/7/2023) Pukul 03:00 WITA.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Dalam hal ini, kepala Bidang dan Kedaruratan Badan Penanggulangan Bencana Daerah ( BPBD) Provinsi Sulawesi Tengah, Andy Sembiring mengatakan melalui data terdapat 15 unit rumah warga yang terdampak.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">\"Melalui data, terdapat 15 unit rumah warga yang terdampak Abrasi pantai dan saat ini 5 Kepala Keluarga yang saat ini tengah mengungsi,\" Ucap Kepala bidang kedaruratan dan logistik</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Adapun kronologis dari kejadian ini karena tingginya air laut di sekitar Desa Matanga serta kondisi Tanggul Laut (Talut) yang sudah tidak berfungsi dengan baik menyebabkan gelombang air laut hingga naik kepemukiman dan merusak beberapa rumah warga</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Untuk situasi terakhir sebagian warga yang terdampak mengungsi ke rumah kerabat dan upaya BPBD menghimbau warga untuk tetap selalu waspada terhadap abrasi pantai susulan.</p><p><br></p>', '1716480337501-20232707101710.jpeg', 'http://localhost:5001/public/images/1716480337501-20232707101710.jpeg', '2024-05-23 16:05:37', '2024-05-23 16:05:37');
