INSERT INTO `kejadian_bencanas` (`id_kejadian`, `id_user`, `id_jenis_kejadian`, `kronologis`, `tanggal`, `jam`, `titik_lokasi`, `file_laporan_akhir`, `url`, `status_ditangani`, `verification`, `created_at`, `updated_at`, `deleted_at`, `ket`) VALUES
('50f06612-b7c7-49ca-9b77-81feec240e4d', 1, 'd46304c1-8e72-4f57-be3b-4c7458e7202f', 'Saat ini, masih dilakukan pendistribusian air dengan 3 unit mobil tangki. Air bersih diperoleh dari PDAM Bulagi dan sumber air yang terletak di Desa Bangunemo dengan jarak 23 KM dari Desa Alul. Akses jalan ke Desa Alul yang rusak mengakibatkan proses pengambilan dan pendistribusian air memakan waktu yang lama, serta tedapat kendala pada 2 unit mobil tangki dan tidak dapat melakukan pendistribusian di Desa Alul.\r\n\r\nSituasi saat ini, kondisi kekeringan masih berlangsung, masih dibutuhkan air bersih dan mobil tangki air untuk mendukung proses pendistribusian air yang lebih efektif dan merata di seluruh wilayah terdampak.', '2024-05-24', '23:55', 'http://localhost:5173/tambah-data-bencana', '1716479833968-DIBSULTENG.pdf', 'http://localhost:5001/public/images/1716479833968-DIBSULTENG.pdf', 'Ya', 0, '2024-05-23 15:57:13', '2024-05-23 15:57:13', NULL, '7203'),
('ad42b205-6bb8-4275-be77-308ae44cf945', 1, 'ae5acdf9-d4be-4e54-80f9-4cb01a0196e9', 'Saat ini, masih dilakukan pendistribusian air dengan 3 unit mobil tangki. Air bersih diperoleh dari PDAM Bulagi dan sumber air yang terletak di Desa Bangunemo dengan jarak 23 KM dari Desa Alul. Akses jalan ke Desa Alul yang rusak mengakibatkan proses pengambilan dan pendistribusian air memakan waktu yang lama, serta tedapat kendala pada 2 unit mobil tangki dan tidak dapat melakukan pendistribusian di Desa Alul.\r\n\r\nSituasi saat ini, kondisi kekeringan masih berlangsung, masih dibutuhkan air bersih dan mobil tangki air untuk mendukung proses pendistribusian air yang lebih efektif dan merata di seluruh wilayah terdampak.', '2024-05-02', '23:57', '', '', '', 'Tidak', 0, '2024-05-23 15:58:12', '2024-05-23 15:58:12', NULL, '7203'),
('baa3c42a-d139-41e6-b179-d1fd85839f81', 1, 'd9095049-965c-497f-98c9-e040060bcc3f', 'Saat ini, masih dilakukan pendistribusian air dengan 3 unit mobil tangki. Air bersih diperoleh dari PDAM Bulagi dan sumber air yang terletak di Desa Bangunemo dengan jarak 23 KM dari Desa Alul. Akses jalan ke Desa Alul yang rusak mengakibatkan proses pengambilan dan pendistribusian air memakan waktu yang lama, serta tedapat kendala pada 2 unit mobil tangki dan tidak dapat melakukan pendistribusian di Desa Alul.\r\n\r\nSituasi saat ini, kondisi kekeringan masih berlangsung, masih dibutuhkan air bersih dan mobil tangki air untuk mendukung proses pendistribusian air yang lebih efektif dan merata di seluruh wilayah terdampak.', '2023-10-17', '23:59', '', '1716479942298-DIBSULTENG.pdf', 'http://localhost:5001/public/images/1716479942298-DIBSULTENG.pdf', 'Ya', 0, '2024-05-23 15:59:02', '2024-05-23 15:59:02', NULL, '7210');
